import React from 'react';

const FacultyLogin = () => {
    return (
        <div>
            <h1>Faculty Login</h1>
            <form>
                <label>Email:</label>
                <input type="email" placeholder="Enter Email" />
                <br />
                <label>Password:</label>
                <input type="password" placeholder="Enter Password" />
                <br />
                <button type="submit">Login</button>
            </form>
        </div>
    );
};

export default FacultyLogin;
